import React from 'react';
import f1logo from './f1logo.jpg';



function ButtonHome () {

    return (
            
        <a className="buttonhome" href="/">
            <img className="homelogo" src={f1logo}/>
        </a>  
    
    )
    }
    
export default ButtonHome;
